(8, 11, 'Адреса необходимых ресурсов', '<ul>\r\n<li><a href=\"https://monitoring.rgs.ru/site/login\" target=\"_blank\" rel=\"noopener\">Инфраструктура и сервисы</a></li>\r\n<li><a href=\"https://lansweeper.rgs.ru:82/\" target=\"_blank\" rel=\"noopener\">Lansweeper</a></li>\r\n<li><a href=\"http://10.224.1.84/\" target=\"_blank\" rel=\"noopener\">Комната аудиоконференции Брянск</a></li>\r\n<li><a href=\"https://vclass.rgs.ru/brynsk/\" target=\"_blank\" rel=\"noopener\">Комната Виртуального класса Брянск</a></li>\r\n<li><a href=\"https://mail.bryansk.rgs.ru:8010/\" target=\"_blank\" rel=\"noopener\">CommuniGate Брянск</a></li>\r\n<li><a href=\"https://mail.bryansk.rgs.ru\" target=\"_blank\" rel=\"noopener\">Веб-морда почты Брянск</a></li>\r\n<li><a href=\"http://10.77.1.82:2002/\" target=\"_blank\" rel=\"noopener\">Cisco Secure ACS</a></li>\r\n<li><a href=\"https://delo-prod.rgs.ru/delo/\">САД-Дело</a></li>\r\n<li>КИАС - ссылка для открытия в IE: <code><font face=\"Courier New\">\"C:\\Program Files\\Internet Explorer\\iexplore.exe\" https://kias-rds/RDWeb</font></code></li>\r\n</ul>', '2020-07-17 18:25:50', '2020-07-24 12:06:18'),
(9, 1, 'Удаленное запаролевание BIOS в HP', '<p>Файлы есть на x:\\BIOS пароли\\HP и на c:\\!IT\\BIOS\\HP</p>\r\n<p>1. Создан pass.bin с паролем:<br />HpqPswd.exe /s /p\"здесь_пароль\" /f\"pass.bin\"</p>\r\n<p>2. Скопированы на целевой ПК файлы:<br />BiosConfigUtility.exe и pass.bin</p>\r\n<p>3. Установление пароля на БИОС путем запуска команды:<br />BIOSConfigUtility.exe /nspwdfile:\"pass.bin\"</p>', '2020-07-17 18:33:50', '2020-09-02 09:35:02'),
(10, 2, 'Потеря доверительных отношений с Доменом', '<ol>\r\n<li>В командной строке RAdmin активировать локального администратора: <code>net user master /active:yes</code></li>\r\n<li>Задать пароль (например, 123456) master\'у: <code>net user master 123456</code>&nbsp;</li>\r\n<li>Войти под УЗ master, изменив на вход в локальную группу: имя_пк\\master и используя созданный пароль.</li>\r\n<li>Запустить profwiz в папке c:\\!IT</li>\r\n<li>Вывести компьютер из Домена, выбрав WORKGROUP.</li>\r\n<li>Перезагрузка.</li>\r\n<li>Переустановить УЗ компьютера в Домене (оснастка Active Directory Пользователи и Компьютеры).</li>\r\n<li>Войти под УЗ master или локального администратора и ввести компьютер в Домен (profwiz).</li>\r\n</ol>', '2020-07-17 19:34:50', '2020-11-02 07:29:25'),
(11, 7, 'Настройки LDAP в Windows Live Mail', '<p>Имя сервера: rgs.ru</p>\r\n<p>Выбрать \"Требуется вход на сервер\", ввести имя_пользователя@rgs.ru и пароль доменной УЗ.</p>\r\n<p>Порт сервера: 3268</p>\r\n<p>Основы поиска: OU=ПАО Росгосстрах,OU=Structure,DC=rgs,DC=ru</p>', '2020-07-17 19:41:16', '2020-07-17 19:41:16'),
(12, 4, 'В Windows Live Mail ошибка установки NET Framework', '<p><strong>Вариант по сети: <span style=\"text-decoration: underline;\">под администратором</span> в powershell:</strong><br /><code>Enable-WindowsOptionalFeature -Online -FeatureName \"NetFx3\" -Source \\\\10.32.1.23\\win10$\\SW_DVD9_Win_Pro_10_1909_64BIT_Russian_Pro_Ent_EDU_N_MLF_X22-17413\\sources\\sxs</code></p>\r\n<p><strong>Вариант с флешкой (образом) cmd:</strong></p>\r\n<p>Подключить установочную флешку или смонтировать образ с Windows 10.<br /><code>dism /Online /Enable-Feature /FeatureName:NetFx3 /All /LimitAccess /Source:d:\\sources\\sxs</code>&nbsp;</p>\r\n<p>где d: - флешка/диск</p>', '2020-07-17 22:13:02', '2020-08-11 07:00:06'),
(16, 12, 'Эврика - неоригинальные расходные материалы (основной)', '<h3><span style=\"mso-fareast-language: RU;\"><font color=\"#1f497d\" face=\"Times New Roman\">Договор № ПД-919 от 22.06.2020г. с ООО \"Эврика\".</font></span></h3>\r\n<p class=\"MsoNormal\"><strong><span style=\"text-decoration: underline;\"><span style=\"mso-fareast-language: RU;\">Контакты:</span></span></strong></p>\r\n<div class=\"MsoNormal\"><span style=\"mso-fareast-language: RU;\"><span style=\"text-decoration: underline;\">Юлиана Пустовалова</span> <code><font color=\"#0563c1\">Y.Pustovalova@eureca.pro</font></code></span></div>\r\n<div class=\"MsoNormal\"><span style=\"mso-fareast-language: RU;\"></span><span style=\"mso-fareast-language: RU;\">Моб. +7(977) 831-34-19</span><span style=\"mso-fareast-language: RU;\"></span></div>\r\n<div class=\"MsoNormal\"><span style=\"mso-fareast-language: RU;\"><span style=\"text-decoration: underline;\">Гладченко Роман Петрович</span> <code><font color=\"#0563c1\">r.gladchenko@eureca.pro</font></code></span></div>\r\n<div class=\"MsoNormal\"><span style=\"mso-fareast-language: RU;\">моб: +7 (916) 340 2860</span></div>\r\n<div class=\"MsoNormal\">&nbsp;</div>\r\n<p class=\"MsoNormal\"><span style=\"mso-fareast-language: RU;\"></span><span style=\"mso-fareast-language: RU;\">Если требуется приобретение расходных материалов по позициям, отсутствующих в договоре, необходимо предоставить коммерческие предложения от 3-х поставщиков на адрес <code><span style=\"text-decoration: none;\"><font>Oksana_Gorshkova@rgs.ru</font></span></code>. Можно запрашивать в том числе и ООО &laquo;Принтэко-Сейлс&raquo; - резервный поставщик по решению Тендерного комитета</span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><span>Документы АХД для оформления ЗНП в КИАС:</span></p>\r\n<p class=\"MsoListParagraph\"><span>ООО &laquo;Эврика&raquo; -- <span style=\"background: yellow; mso-highlight: yellow;\">ДОУ-199-12707/20</span></span></p>\r\n<p>&nbsp;</p>\r\n