(17, 12, 'ООО \"СоюзИнтегро\" - оригинальные и совместимые расходные материалы', '<h3><font color=\"#44546a\">Договор № 160517 от 16.05.2017г. с ООО \"СоюзИнтегро\".</font></h3>\r\n<p><font color=\"#44546a\">Цены на расходные материалы, указанные в Договоре, действуют до 28.06.2021г.<font color=\"#000000\"> </font></font></p>\r\n<p><span style=\"text-decoration: underline;\"><font color=\"#44546a\">Контакты для оформления счетов:</font></span></p>\r\n<p><font color=\"#44546a\"><em><span>Антон Иванов. </span></em></font><font color=\"#44546a\"><em><span>тел.: 8 (499) 290-51-26 (33627), </span></em></font><font color=\"#44546a\"><em><span>тел.: 8 (495) 937-27-26, </span></em></font><font color=\"#44546a\"><em><span>моб.: 8 (917) 545-81-17</span></em></font></p>\r\n<p><font color=\"#44546a\"><em><span><span style=\"text-decoration: none;\">anivanov@soyuzintegro.ru</span></span></em></font></p>\r\n<p><span style=\"text-decoration: underline;\"><font color=\"#44546a\"><span style=\"text-decoration: none;\"><font color=\"#44546a\"><span style=\"text-decoration: none;\">Документы АХД для оформления ЗНП в КИАС:</span></font></span></font></span></p>\r\n<p class=\"MsoListParagraph\"><span>ООО &laquo;СоюзИнтегро&raquo; - <span style=\"background: yellow; mso-highlight: yellow;\">27850011_ДГП0122231</span></span></p>', '2020-07-20 09:35:09', '2020-07-20 09:44:19'),
(18, 12, 'ПринтЭко - резервный поставщик совместимой расходки', '<p>Заказывать у них, если доставка из Эврики дорогая.</p>\r\n<p class=\"MsoNormal\"><span style=\"mso-fareast-language: RU;\">Коллеги, добрый день</span></p>\r\n<p><span style=\"mso-fareast-language: RU;\">В</span><em> ООО &laquo;ПРИНТЭКО-Сейлс&raquo; изменились контакты для оформления счетов</em></p>\r\n<p><span style=\"mso-fareast-language: RU;\">Запросы можете направлять на адрес</span></p>\r\n<p><strong><span style=\"mso-fareast-language: RU;\">Молчанов Евгений</span></strong></p>\r\n<p><strong><span style=\"mso-fareast-language: RU;\">Региональный менеджер по оптовым продажам</span></strong></p>\r\n<p><strong><span style=\"mso-fareast-language: RU;\">Рабочий: &nbsp;8 (495) 545-05-01 доб 1519</span></strong></p>\r\n<p><strong><span style=\"mso-fareast-language: RU;\">Мобильный:&nbsp;&nbsp;8 (926) 229-06-98</span></strong></p>\r\n<p><strong>Mail:&nbsp;&nbsp;<span style=\"text-decoration: none; mso-fareast-language: EN-US;\">emolchanov@nvprint.ru</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Оригиналы документов высылать по адресу:<br />109029, г. Москва , ул. Скотопрогонная 27/26, стр. 1, БЦ &laquo;РТС&raquo;, 4 этаж.</p>', '2020-07-20 12:37:13', '2021-02-12 09:39:49'),
(19, 11, 'АС бюджетирования Oracle Hyperion и Smart View', '<p class=\"MsoPlainText\"><span style=\"mso-fareast-language: RU;\">Ссылка для входа в Облако:</span></p>\r\n<p class=\"MsoPlainText\"><a href=\"https://planning-a524071.pbcs.em2.oraclecloud.com/workspace\"><font color=\"#0000ff\">https://planning-a524071.pbcs.em2.oraclecloud.com/workspace</font></a></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">Также возможна работа в <span lang=\"EN-US\">Excel </span>при условии, что на компьютер пользователя установлена надстройка <span lang=\"EN-US\">Oracle SmartView for MS Office</span>.</p>\r\n<p class=\"MsoNormal\">Настройки во вложениях &rArr;</p>', '2020-07-20 17:25:36', '2020-07-20 17:27:14'),
(20, 10, 'Kyocera ECOSYS инженерное меню 10871087', '<p><strong>U000</strong> - Вывод отчета по техническому обслуживанию</p>\r\n<p><strong>U002</strong> - сброс данных на заводские настройки</p>\r\n<p><strong>U004</strong> - установка номера аппарата</p>\r\n<p><strong>U203</strong> - проверка работы DP</p>\r\n<p><strong>U250</strong> - установка цикла обслуживания</p>\r\n<p><strong>U251</strong> - проверка/очистка счетчика обслуживания</p>\r\n<p><strong>U252</strong> - установка местоположения</p>\r\n<p><strong>U253</strong> - переключение между одинарными и двойными счетчиками</p>\r\n<p><strong>U260</strong> - выбор времени для подсчета копий</p>\r\n<p><strong>U285</strong> - настройка страницы состояния</p>\r\n<p><strong>U411</strong> - авто настройка сканирования</p>\r\n<p><strong>U425</strong> - установка задания</p>\r\n<hr />\r\n<p><strong>U600 - U699</strong> - настройки факса</p>\r\n<hr />\r\n<p><strong>U910</strong> - Clearing the black ratio data (очистка данных)</p>\r\n<p><strong>U917</strong> - настройка резервного копирования/чтения данных</p>\r\n<p><strong>U927</strong> - Clearing the all copy counts and machine life counts (очистка всех счетчиков)</p>', '2020-07-21 07:19:01', '2020-07-22 12:49:06'),
(21, 12, 'Пролог Резерв - расходные материалы для сканеров Avision', '<p>ООО &laquo;Пролог Резерв&raquo; подписано ДС № 1.</p>\r\n<p>При оформлении ЗНП использовать документ АХД - 16950010_ДГП0016782.</p>\r\n<p><span style=\"text-decoration: underline;\">Контакты:</span></p>\r\n<p><code>vadim.goncharov@staten.ru</code></p>', '2020-07-21 07:24:18', '2020-07-21 07:24:18'),
(22, 11, 'Ежемесячные фото серверной', '<p><a href=\"https://fs-rds.rgs.ru/\" target=\"_blank\" rel=\"noopener\">&rArr; https://fs-rds.rgs.ru/ &lArr;</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>А также по адресу:</strong></p>\r\n<p>\\\\ktj-fs-01.rgs.ru\\regions$</p>', '2020-07-21 12:40:11', '2020-12-23 13:19:15'),
