(25, 11, '1С Учет Активов', '<p>Установщик на <strong>ftp</strong> и на <strong>\\\\10.32.1.23\\апо\\8_3_16_1148.zip</strong></p>\r\n<p>Использую WEB, ярлык: <code>\"C:\\Program Files (x86)\\1cv8\\8.3.16.1148\\bin\\1cv8c.exe\" /WS \"http://one-window-new.rgs.ru/itam_83\"</code></p>', '2020-07-22 07:30:07', '2020-07-24 12:11:41'),
