(27, 11, 'RuToken - Удаленка с токеном. Адреса и настройки', '<p>Настройки во вложении (драйверы, ПО) &rarr;</p>\r\n<p>Адрес VPN: <code><font size=\"5\">msk-kitezh-rgs-vpn-8.rgs.ru </font></code></p>\r\n<p>Драйвер на ТОКЕН: <a href=\"https://www.rutoken.ru/support/download/windows/\" target=\"_blank\" rel=\"noopener\"><code>https://www.rutoken.ru/support/download/windows/</code></a></p>\r\n<p>&nbsp;</p>', '2020-07-22 07:52:30', '2020-09-24 08:22:46'),
(28, 12, 'ООО \"ВОИП ТЕЛЕКОМ\". Termit. Термиты.', '<h3><font size=\"2\" face=\"Tahoma\">mail@voipdevice.ru</font></h3>\r\n<p>Phone: +7 (495) 514-9161 ext. 512</p>\r\n<p>Mobile: +7 (977) 691-0422</p>\r\n<p>Free: 88001001812</p>\r\n<p>ICQ:&nbsp; 554400441</p>\r\n<p>&nbsp;</p>\r\n<p><font color=\"#1f497d\">Документ АХД </font><span style=\"background: yellow; mso-highlight: yellow;\">ДКП-199-01893/19</span></p>\r\n<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold; mso-bidi-font-style: italic;\">ООО \"ВОИП ТЕЛЕКОМ\", ИНН 7733663234, КПП 773301001, 125368, Москва г, Дубравная ул, дом № 36, тел.: +7(495) 514-9161</span></p>', '2020-07-22 07:58:16', '2020-07-23 06:48:13'),
(29, 11, 'Тесса', '<p>Инсталяшка от <strong>июня 2020 г.</strong> (TessaApplications.msi) &rarr;</p>\r\n<p>Документация &rarr;</p>\r\n<p>9 видосиков по работе в Тесса есть на: <a href=\"../all_video\">http://bryansk/all_video</a></p>\r\n<p>&nbsp;</p>', '2020-07-23 15:23:55', '2020-07-24 12:10:00'),
(30, 4, 'Создание установочного образа Windows 10. часть 1 - снятие образа в ESD', '<p>1. Установка Windows10 на машину. Установка драйверов. Установка ПО (не активированный MS Office не перенесется - можно не устанавливать).</p>\r\n<p>2. Запуск <code>c:\\Windows\\System32\\Sysprep\\sysprep</code> - выбрать: \"...... ODBE\", чекбокс, \"Завершение работы\"</p>\r\n<p>3. Загрузка с загрузочной (старого образа) флешки + накопитель &gt; 9 Гб.</p>\r\n<p>4. В начальном окне установки Windows 10 - <strong>SHIFT+F10</strong></p>\r\n<p>5. В командной строке:</p>\r\n<p>&emsp;<code>diskpart</code></p>\r\n<p><code>&emsp;lis vol</code></p>\r\n<p>чтобы узнать буквы дисков с системой и внешнего накопителя.</p>\r\n<p>6. <code>exit</code></p>\r\n<p>7. <code>Dism /Capture-Image /ImageFile:I:\\install.esd /CaptureDir:C:\\ /Name:Windows</code></p>\r\n<p>где,<strong> install.esd </strong>- название будущего ESD-образа системы;</p>\r\n<p><strong>I:\\</strong> - внешний накопитель;</p>\r\n<p><strong>C:\\</strong> - диск с Windows 10.</p>', '2020-07-23 15:57:45', '2020-07-23 15:58:34'),
(31, 8, 'АПО2 \"Текущая дата на вашем компьютере лежит вне интервала даты системы РОСГОССТРАХ!\"', '<p class=\"MsoNormal\">Решение по ошибке в АПО2 \"Текущая дата на вашем компьютере лежит вне интервала даты системы РОСГОССТРАХ!\"</p>\r\n<p class=\"MsoNormal\">1. Зажимаете значок WINDOWS (между Ctrl и Alt) и \"R\"</p>\r\n<p class=\"MsoNormal\">2. В появившемся окне пишите на английском: cmd</p>\r\n<p class=\"MsoNormal\">3. Жмёте ОК, появляется черное окно - \"командная строка\"</p>\r\n<p class=\"MsoNormal\">4. Копируете вот это: bcdedit.exe /set {current} nx AlwaysOff</p>\r\n<p class=\"MsoNormal\">5. Нажимате правую кнопку мыши в командной строке &ndash; вставить</p>\r\n<p class=\"MsoNormal\">6. Жмете Enter</p>\r\n<p class=\"MsoNormal\">7. Ждёте команды \"операция успешно завершена\" от командной строки</p>\r\n<p class=\"MsoNormal\">8. Закрываете командную строку</p>\r\n<p class=\"MsoNormal\">9. Перезапускаете АПО и повторяете операцию с договором.</p>', '2020-07-24 06:41:32', '2020-07-24 06:41:32'),
(32, 4, 'Создание установочного образа Windows 10. часть 2 - Конвертация образа ESD в WIM', '<p><span style=\"text-decoration: underline;\"><strong>&alefsym; Конвертацию делать на ПК с Windows 10 и выше &alefsym;</strong></span></p>\r\n<p>1. Просмотреть информацию об образе ESD (узнать нужный индекс версии, если в файле есть несколько образов):</p>\r\n<p><code>&emsp;cmd</code> <strong>ПОД АДМИНИСТРАТОРОМ:</strong></p>\r\n<p><code>&emsp;DISM /Get-WimInfo /WimFile:\"C:\\!IT\\install.esd\"</code></p>\r\n<p>&emsp;где, <strong>C:\\!IT\\install.esd</strong> - расположение esd-файла на компьютере.</p>\r\n<p>2. Конвертация:</p>\r\n<p><code>&emsp;DISM /export-image /SourceImageFile:C:\\!IT\\install.esd /SourceIndex:1 /DestinationImageFile:C:\\!IT\\install.wim /Compress:max /CheckIntegrity</code></p>\r\n<p>&emsp;где, <strong>C:\\!IT\\install.esd</strong> - расположение esd-образа на ПК,</p>\r\n<p>&emsp;/SourceIndex:<strong>1</strong> - номер индекса образа, полученый в п.1,</p>\r\n<p><strong>&emsp;C:\\!IT\\install.wim</strong> - имя и расположение создаваемого wim-файла.</p>\r\n<p>Для установки Windows 10 по сети с WDS-сервера - этого хватит, т.к. WDS использует wim-образы.</p>\r\n<p>Для создания установочного диска (флешки) - необходимо произвести конвертацию WIM в ISO.</p>', '2020-07-24 08:04:49', '2020-07-24 14:49:20'),
(33, 10, 'Kyocera ECOSYS 2535, 2540. Неправильно установлен картридж и т.п.', '<p>Данная ошибка ошибочно возникает при необходимости заменить отработанный тонер-картридж.</p>', '2020-07-24 08:42:12', '2020-07-24 08:42:12'),
(34, 8, 'В АПО2 ошибка даты в расчетах, если в дате в трее есть строки', '<p>Привести дату в трее к формату \"только цифры\" (изменить отображение даты в трее).</p>\r\n<p>Панель управления - Язык и региональные стандарты - кнопка \"Дополнительные параметры...\"</p>\r\n<p>Привести поле Краткая дата к формату, как на картинке (dd.MM.yyyy) &rarr;</p>', '2020-07-24 09:22:17', '2020-07-24 09:23:57'),
(35, 4, 'Создание установочного образа Windows 10. часть 3 - Конвертация образа WIM в ISO', '<p>1. Создать на флешке папку 10 и скопировать в нее все из распакованного iso-образа Windows 10 (централизованный с ftp).</p>\r\n<p>2. Скопировать с заменой install.wim на флешку в папку 10\\sources</p>\r\n<p>3. Надо скачать и установить Комплект средств для развертывания Windows (windows ADK) (есть на \\\\10.32.1.23\\апо\\Windows) и здесь &rarr;</p>\r\n<p>4. Пуск - Windows Kits - Windows ADK - Среда средств развертывания и работы с образами</p>\r\n<p>5. Команда: <code>Oscdimg /u2 /m /bootdata:2#p0,e,bI:\\10\\boot\\Etfsboot.com#pef,e,bI:\\10\\efi\\microsoft\\boot\\Efisys.bin I:\\10 C:\\!IT\\Windows.iso</code></p>\r\n<p>&emsp;где, <strong>u2</strong> - файловая система UDF,</p>\r\n<p>&emsp;<strong>m</strong> - размер образа без ограничений,</p>\r\n<p>&emsp;<strong>b</strong> - загрузочный сектор, путь к файлу etfsboot.com,</p>\r\n<p>&emsp;<strong>bI </strong>- I - буква диска (флешки),</p>\r\n<p>&emsp;<strong>I:\\10</strong> - путь папки 10, с которой делается образ,</p>\r\n<p>&emsp;<strong>C:\\!IT\\Windows.iso</strong> - путь и имя создаваемого образа.</p>', '2020-07-24 15:16:07', '2020-07-24 15:40:22'),
(36, 1, 'Драйверы для Dell OptiPlex 3050 на Windows 10', '<p>Есть на x:\\Драйверы\\ПК\\Dell OptiPlex 3050\\</p>', '2020-07-30 09:13:16', '2020-07-30 09:13:16'),
(37, 4, 'Драйверы для Dell OptiPlex 3050 на Windows 10', '<p><a href=\"36\">Перейти на http://bryansk/wiki/36</a></p>', '2020-07-30 09:14:09', '2020-07-30 09:14:45'),
(38, 1, 'localadmin', '<p>QAZwsx!@#$%</p>', '2020-07-31 15:29:06', '2020-07-31 15:29:06'),
(39, 8, 'Программа для упрощения восстановления АПО из backups - apoback.exe', '<p>Только запустить. Откроется консоль и все сообщения будут в консоли.</p>\r\n<p>Программа автоматически определяет наличие любого количества установок АПО3, для этого предварительно сканируются четыре расположения на системном диске:</p>\r\n<p><code>%SysDrive%\\RGS; %USERPROFILE%\\Desktop; %USERPROFILE%\\Documets; %USERPROFILE%\\Downloads</code></p>\r\n<p>Затем автоматически производит поиск бэкапов в найденном расположении + backups\\</p>\r\n<p>и запрашивает на какую дату (из существующих бэкапов) произвести восстановление. Текущий файл БД АПО сохраняется в backups\\ с текущей датой и расширением .bkm</p>\r\n<p>Если в перечисленных расположениях АПО3 не обнаружено, запрашивает - произвести поиск на доступных дисках. Используется линейный поиск, поэтому время поиска зависит от \"захламленности\" дисков и занимает продолжительное время.</p>\r\n<p><strong>Внимание: </strong>Антивирус может блокировать выполнение программы.</p>\r\n<p><strong>Добавил разделение на 32-bit и 64-bit версии программы</strong></p>\r\n<hr />\r\n<p><strong>В версии 1.1 добавлено:</strong> <span style=\"text-decoration: underline;\">Только для опытных пользователей.</span> Если для запуска программы вы используете консоль, то можно сразу указать путь установки АПО3. Путь указывается от корня диска, без пробелов и в \"терминологии Windows\". Если в пути встречаются пробелы (например, в названии папки), то путь необходимо взять в ДВОЙНЫЕ кавычки.</p>\r\n<p>Например, <code>apoback.exe c:\\rgs\\apo2_r_agent</code></p>\r\n<p>или <code>apoback.exe \"c:\\rgs\\программа апо\\\"</code></p>', '2020-08-03 08:05:10', '2020-09-02 07:45:11'),
(40, 8, 'Отключение Предотвращения выполнения данных (DEP) - apodep.exe', '<p>Консольная утилита (\"только запустить\") для автоматического поиска всех установленных АПО3 и автоматического выключения DEP для всех найденных версий.</p>\r\n<p>После успешного окончания программы будет выполнена автоматическая перезагрузка ПК через 1 минуту.</p>\r\n<blockquote>\r\n<p><em>ВНИМАНИЕ: не тестировал на Windows XP.</em></p>\r\n<p><em>ВНИМАНИЕ: антивирусник может блокировать выполнение программы.</em></p>\r\n</blockquote>\r\n<hr />\r\n<p><strong>В версии 1.1 добавлено:</strong> <span style=\"text-decoration: underline;\">Только для опытных пользователей.</span> Если для запуска программы вы используете консоль, то можно сразу указать путь установки АПО3. Путь указывается от корня диска, без пробелов и в \"терминологии Windows\". Если в пути встречаются пробелы (например, в названии папки), то путь необходимо взять в ДВОЙНЫЕ кавычки.</p>\r\n<p>Например, <code>apodep.exe c:\\rgs\\apo2_r_agent</code></p>\r\n<p>или <code>apodep.exe \"c:\\rgs\\программа апо\\\"</code></p>\r\n<p><strong>Разделил на 64-bit и 32-bit версии Windows</strong></p>\r\n<p>&nbsp;</p>', '2020-08-05 06:24:13', '2020-09-02 07:39:57'),
(41, 7, 'Настройки LDAP в MS Outlook', '<p>1. Файл - Настройка учетных записей - закладка Адресные книги - \"Создать\"</p>\r\n<p>Имя везде (для примера) <strong>rgs.ru</strong></p>\r\n<p>Поставить галочку \"Требуется вход на сервер\" - ввести УД AD пользователя (имя - с <code>@rgs.ru</code>)</p>\r\n<p>Кнопка \"Другие настройки\" - порт 3268</p>\r\n<p>База поиска (другая): <code>OU=ПАО Росгосстрах,OU=Structure,DC=rgs,DC=ru</code></p>\r\n<p>2. На главной панели выбрать Адресная книга - Сервис - Параметры</p>\r\n<p>Для того, чтобы каталог LDAP рассматривался первым, сделать все настройки как на картинке &rarr;</p>', '2020-08-05 07:38:40', '2020-08-05 07:38:40'),
(42, 1, 'Очистка кэша DNS', '<p><code>ipconfig /flushdns</code></p>\r\n<p><code>ipconfig /registerdns</code></p>', '2020-08-10 07:23:41', '2020-08-10 07:23:41'),
(43, 13, 'Тесса. Видео и документация', '<p>Видео <a title=\"Видео по Тессе\" href=\"../all_video\" target=\"_blank\" rel=\"noopener\">&rArr;здесь&lArr;</a></p>\r\n<p>Документы здесь &rarr;</p>', '2020-08-10 07:45:38', '2020-08-10 07:47:23'),
(44, 14, 'Сброс телефонов Cisco 79XX на заводские установки', '<p>1. На выключенном телефоне нажать кнопку шарп (#) и не отпуская ее включить телефон.</p>\r\n<p>2. Немного подождать,&nbsp;должны замигать кнопки, такие как: <strong>Headset | Mute | Speaker</strong>. После этого отпустить кнопку <strong>&laquo;#&raquo;</strong></p>\r\n<p>3. После всего этого на экране нашего телефона появится приглашение на ввод, необходимо ввести:<br /><strong>123456789*0#</strong>. Эта последовательность &laquo;говорит&raquo; устройству cisco о том, что <em>необходимо сбросить все настройки</em></p>\r\n<p>&nbsp;</p>\r\n<p>Если набрать неправильно код (<strong>123456789*0#</strong>) , телефон продолжит загрузку в штатном режиме, ничего не сбросится.</p>\r\n<p>&nbsp;</p>\r\n<p>Если на приглашение ничего не ввести, через некоторое время (около 60 сек) загрузка пройдет также в штатном режиме.</p>', '2020-08-21 09:49:12', '2020-08-21 09:49:45'),
(45, 14, 'ip-телефония Е1 Дирекции. ИЗМЕНЕНИЕ ИМЕНИ НА ТЕЛЕФОННОМ АППАРАТЕ', '<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> </span><strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">\"ИЗМЕНЕНИЕ ИМЕНИ НА ТЕЛЕФОННОМ АППАРАТЕ\"</span></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">1.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> Внутренний номер: <strong><span>0771234</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">2.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> MAC адрес устройства: <strong><span>000123456789</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">3.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> Прежнее имя на телефонном аппарате: <strong><span>Smirnov Vladimir</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">4.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> Новое имя на телефонном аппарате: <strong><span>Petrov Mikhail</span></strong><br /><br /></span><strong><u><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Пояснения и рекомендации : </span></u></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br />Внутренний номер указывается в 7 знаков обязательно начинается с нуля. MAC адрес телефона состоит из 12 символов ( цифры и буквы только латиница). Новое имя на телефоне указывать латиницей (с начало Фамилия потом Имя). Собственные имена существительные пишутся с большой буквы. Прошу Вас не использовать в данном примере в вн. номере или MAC адресе какие-либо знаки (- тире, пробел, кавычки, скобки и т.д). Во избежание ошибок, при изменениях в АТС прошу указывать более полную и подробную информацию. Не менять существующую нумерацию. Если что не знаете оставляйте поля пустыми. <br /><br /></span><strong><u><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Исключения из правил :</span></u></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> Существуют телефонные аппараты, у которых нет дисплея ( к примеру Сisco 7902) Достаточно сообщить только MAC адрес телефона, либо если знаете то его внутренний номер. <br /><br /></span><strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">ВНИМАНИЕ!! </span></strong><strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">С начало указываем Фамилию потом Имя </span></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /></span></p>', '2020-08-21 10:07:53', '2020-08-21 10:07:53'),
(46, 14, 'ip-телефония Е1 Дирекции. РАСПРЕДЕЛЕНИЕ ВХОДЯЩИХ ВЫЗОВОВ', '<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><strong>РАСПРЕДЕЛЕНИЕ ВХОДЯЩИХ ВЫЗОВОВ</strong></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">1. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Городской номер: <strong><span>4957832424</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">2. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Тип порта: <strong><span>Е1/FXO </span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">3. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Тип Распределения вызовов: <strong><span>Последовательный/Широковещательный </span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Было:</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> <strong><span>0771234 --&gt; 0774321 --&gt; 0775678 </span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Нужно:</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> <strong><span>0774321 --&gt; 0779876 --&gt; 0777896</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Примечание:</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> Изменить порядок вх. вызовов. Добавить/удалить вн. номер в группе. Время при последовательных звонках &ndash; 10 сек.<br /><br /></span><strong><u><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Пояснения и рекомендации : </span></u></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /><br />Данный пример используется для того, чтобы местный городской номер направить на внутренний номер, либо на группу внутренних номеров. Т.е. необходимо указать какой тип вызова будет использоваться при групповых входящих вызовах. При <strong><span>Широковещательном</span></strong> вызове - звонят все телефонные аппараты в группе одновременно. </span></p>\r\n<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Обозначения: (0771234, 0774321, 0775678). </span></p>\r\n<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">При <strong><span>последовательном</span></strong> вызове - начинают звонить телефоны в определенной последовательности, ту которую вы сами зададите. Нужно также указать интервал в секундах (3 гудка примерно10-12 сек), через которое время вызов уйдет на другой телефонный аппарат в случае не ответа. Если время не задано в заявке, то ставятся настройки по умолчанию 10 сек. </span></p>\r\n<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Обозначения: (0774321 --&gt; 0779876 --&gt; 0777896). <br /></span></p>\r\n<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Так же прошу указывать тип порта E1 - когда номер уходит в поток Е1, либо аналоговый порт FXO/FXS<br />В примечании можно и нужно указать дополнительную информацию.<br /><br /></span><strong><u><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Исключения из правил :</span></u></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br />В случае если вы не знаете как у Вас внутри офиса/филиала работает телефония, и Вы не знаете как у Вас проходят городские звонки на внутренние номера, то поле как Было можно оставить пустым. Прошу Вас не создавать сложных схем групп вызовов. Так как самим потом будет трудно разобраться в маршрутизации. Тем самым ставя бизнес под угрозу в случае недозвона.</span></p>', '2020-08-21 11:34:24', '2020-08-21 11:34:24'),
(47, 14, 'ip-телефония Е1 Дирекции. РЕГИСТРАЦИЯ НОВОГО ТЕЛЕФОННОГО АППАРАТА', '<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><strong>РЕГИСТРАЦИЯ НОВОГО ТЕЛЕФОННОГО АППАРАТА</strong></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">1.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> Технологический номер: <strong><span>941234</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">2. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Внутренний тел. номер с префиксом: <strong><span>0771234</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">3.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> MAC адрес устройства: <strong><span>000123456789</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">4. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Имя на телефонном аппарате: <strong><span>Smirnov Vladimir</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">5. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Исходящий номер: <strong><span>4957832424 </span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">6. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Права доступа: <strong><span>гор/моб/мг/мн</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">7. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Местоположение тел. аппарата: <strong><span>Дирекция/ЦУУ/Жизнь</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">8. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Примечание: <strong><span>Телефонный аппарат включен в сеть. вн. номер 0771234</span></strong><br /><br /></span><strong><u><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Пояснения и рекомендации : </span></u></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /><br /><strong>Технологический номер</strong> - это номер присваиваться телефонному аппарату автоматический при включении его в корпоративную сеть. Начинается этот номер на 94ХХХХ ( Обратите внимание на 94, без нуля). После того как телефонному аппарату был присвоен техн. номер, его нужно зарегистрировать в АТС, для того чтобы можно было звонить с него и на него. Как писал выше есть телефонные аппараты на которых нет дисплея, и этот номер Вы никогда не увидите. То пункт п.1. оставляем пустым. Достаточно будет сообщить нам его MAC адрес. Имя указывайте пожалуйста латиницей (<strong>с начала фамилия потом имя</strong>).</span></p>\r\n<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> <img src=\"file:///C:/Users/MaksimIT/AppData/Local/Temp/msohtmlclip1/01/clip_image001.gif\" alt=\":!:\" width=\"15\" height=\"15\" />Пункт исходящий номер!!! Прошу Вас не путайте исходящий номер и входящий. Этот пункт заполняют не все регионы и филиалы, а только те у которых выход в город по потоку Е1 и провайдер требует АОН. Права доступа в регионах стандартный: локальные/городские/мобильные/междугородняя связь. (гор/моб/мг/) - открыта, а международная (мн) связь включается отдельно по запросу. Желательно указывать какие права доступа на исх. связь имеет данный номер.Указывайте пожалуйста местоположение телефонного аппарата, для того чтобы было понятно в какой сети находиться данное устройство. НЕ ЗАБЫВАЕМ ЧТО В ВН. НОМЕР ПИШЕТСЯ В 7 ЗНАКОВ СЛИТНО ( без пробелов, точек, кавычек и т.д.)<br /><br /></span><strong><u><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Исключения из правил :</span></u></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /><br /></span><strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">ВНИМАНИЕ ЧИТАТЬ ВСЕМ</span></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">!!! Пункт п.5 заполняется </span><span style=\"text-decoration: underline;\"><span style=\"text-decoration: underline; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">не всеми регионами</span></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">. Подсказка <img src=\"file:///C:/Users/MaksimIT/AppData/Local/Temp/msohtmlclip1/01/clip_image004.gif\" alt=\":wink:\" width=\"15\" height=\"15\" />У кого телефоны с дисплеем могут увидеть в правом верхнем углу городской внешний номер, если указан только внутренний номер то п.5 оставляем пустым. В таком формате и присылайте пожалуйста заявки 6-7-10-11 знаков. Это АОН с которым телефонный аппарат выходит на городскую линию. Есть регионы где не нужно указывать п.5 (стоит один АОН на всем потоке Е1)</span></p>', '2020-08-21 11:42:40', '2020-08-21 17:05:29');
