(48, 14, 'ip-телефония Е1 Дирекции. ИЗМЕНЕНИЕ ДАННЫХ В ТЕЛЕФОННОМ АППАРАТЕ', '<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><strong>ИЗМЕНЕНИЕ ДАННЫХ В ТЕЛЕФОННОМ АППАРАТЕ</strong></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">1. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">MAC-адрес устройства: <strong><span>000123456789</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">2. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Внутренний тел. номер с префиксом: <strong><span>0774321</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">3. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Имя на телефонном аппарате: <strong><span>Smirnov Vladimir </span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">4. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Новый Внутренний тел. номер с префиксом:<strong><span> 0771234</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">5. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Новое Имя на телефонном аппарате: <strong><span>Petrov Mikhail </span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">6. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Исходящий городской номер: <strong><span>4957832424</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">7. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Права доступа: <strong><span>гор/моб/мг</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">8. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Местоположение: <strong><span>Дирекция</span></strong><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">9. </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Примечание: <br />Присвоить данному телефонному аппарату ( MAC 000123456789) вн. номер 0774321 и закрепить за Петровым Михаилом. Аппарат перемещен из &laquo;Жизни&raquo; в &laquo;Дирекцию&raquo;. Необходимо дать право доступа на мг связь. и.т.д. <br />* Телефонный аппарат Cisco 7902 (000123455621) вн. номер: 0771234 Смирнов Владимир удалить и перенести все данные на телефонный аппарат Cisco 7906 MAC 000123456789 вн. номер: 0774321 и присвоить имя Petrov Mikhail.<br />Обратите внимание при переносе с одного тел. аппарата на другой необходимо указывать, тел. аппарат в котором нужно вносить изменения. В данном случае Сisco 7906<br />** Какие либо изменения данных в телефонных аппаратах вносятся после регистрации в сети компании РГС т.е. телефон должен быть в работе и иметь префикс Вашего региона 0YY-XXXX. Телефоны которые начинаются на 94ХХХ необходимо с начало зарегистрировать, а потом внести изменения.<br /><br /></span><strong><u><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Пояснения и рекомендации : </span></u></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br />Данный пример применим к случаю, когда необходимо поменять какой- нибудь параметр в телефонном аппарате ( будь это исходящий номер либо меняются права доступа на исходящую связь), а так же если необходимо телефонный аппарат перерегистрировать на другого человека с изменением внутреннего номера. Или на того же человека но ему присвоить другой вн. номер. И еще в случае если необходимо поменять местами 2 телефонных аппарат. и т.д.<br />* В случае если вся информация переноситься с одного телефонного аппарата на другой, то необходимо указать еще MAC адрес и вн. номер второго телефонного аппарата <br />Все тоже самое рекомендации что и в предыдущих примерах. </span></p>\r\n<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">P.S.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> Прошу Вас в примечании писать все то, что вы бы хотели прокомментировать или добавить в заявку. Будет только плюсом. Например: перерегистрировать и перенести данные с одного телефонного аппарата на другой телефонный аппарат. И т.д. </span></p>', '2020-08-21 11:44:56', '2020-08-21 11:44:56'),
(49, 14, 'ip-телефония Е1 Дирекции. ГРУППА ПОДХВАТА / ПЕРЕХВАТА ВЫЗОВОВ (Call Pickup Groups)', '<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong><span>ГРУППА ПОДХВАТА / ПЕРЕХВАТА ВЫЗОВОВ (Call Pickup Groups)</span></strong><span><br /><br /></span><span>1.</span><span> Было: 0771234, 0775678,<br /></span><span>2.</span><span> <strong><span>Нужно: </span></strong>0771234, 0775678, 0779123<br /><br />Примечание: Прошу Добавить в группу подхвата/перехвата вызовов номер: 0779123 (Пункт 1,2 Обязательно заполняем) / Прошу создать новую группу перехвата вызовов. ( Пункт 1. Было - оставляем пустым)<br />Группа подхвата вызовов, еще называется перехват вызова или Pickup Group. Используется в том случае когда, нужно перехватить вызов с другого тел. аппарата.<br /><br /></span><span>Пример:</span><span><br />В отдел поступил входящий вызов, но сотрудника нет на месте. В этом случае нет необходимости вставать с места и бежать к телефонному аппарату, можно с своего телефонного аппарата перехватить вызов (с помощью кнопки на дисплее телефона \"перехв\").</span></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><span><strong>ВНИМАНИЕ </strong> Случай когда Pickup Group не будет отрабатываться. Когда существует HUNT GROUP (Группа распределения входящих вызовов).<br />т.е. При поступлении звонка из города Pickup Group не будет отрабатываться, при локальном (внутреннем) вызове Pickup Group работает. <br /><br />В случае необходимости подхвата городского вызова существуют следующие ограничения:<br /></span><span>1.</span><span> ПОДХВАТ не работает при широковещательном типе распределения вызова (звонит группа телефонов).<br /></span><span>2.</span><span> В случае последовательного распределения вызовов необходима перенастройка маршрутизации. <br /><br /><strong>ВНИМАНИЕ!</strong> При последовательном распределении вызовов с возможностью подхвата в случае выставления безусловной переадресации на одном из аппаратов в цепочке алгоритм прохождения вызовов будет нарушен. В случае удаления, изменения номера одного из аппаратов в цепочке алгоритм будет так же нарушен. Вследствие этого полную ответственность за правильность прохождения вызовов несет инициатор заявки. Так-же инициатор должен иметь актуальную схему прохождения вызовов и групп подхвата. </span></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><span>Альтернативный,более надежный - это создать группу входящих вызовов с широковещательным типом. Когда может поднять трубку любой свободный человек в группе.</span><font face=\"Times New Roman\"> </font></p>', '2020-08-21 11:50:42', '2020-08-21 11:50:42'),
(50, 14, 'ip-телефония Е1 Дирекции. ЗАЯВКА НА ПОДКЛЮЧЕНИЕ ФАКСА и Аналоговой линии (телефона)', '<p><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">ЗАЯВКА НА ПОДКЛЮЧЕНИЕ ФАКСА и Аналоговой линии (телефона)</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> <br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">ПРИМЕР : </span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br /><br />1. Cisco : <strong><span>2851 </span></strong><br />2. IP Адрес Cisco: <strong><span>10.77.1.99</span></strong><br />3. Module / Subunit / Port :<strong><span>0/1/2</span></strong><br />2. Внутренний тел. номер с префиксом: <strong><span>0771234</span></strong><br />4. Имя на телефонном аппарате: <strong><span>Fax</span></strong><br />5. Городской номер: <strong><span>4957832424</span></strong><br />6. Права доступа: гор/моб/мг/мн<br />7. Местоположение тел. аппарата: <strong><span>Дирекция/ ЦУУ/ Жизнь</span></strong><br />8. Примечание: <strong><span>Телефоны находятся в Жизни. Прошу настроить модуль - NM- 4VWIC- MBRD, Subunit -VIC2-2FXS, Port 2 на Cisco 2851 (10.77.1.99) для подключения аналогового телефона с внутренним номером 0771234. И присвоить имя - Fax. Предоставить права доступа на /гор/моб/мг/мн</span></strong><strong><br /></strong> <br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">P.S.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"> Вот так выглядит в идеале заявка на подключение факсов и аналоговых линий (телефонов) и.д.<br />ВАЖНО!!! Прошу Вас заполнять все поля, а так же не забывать в примечании указывать дополнительную информацию модуль, сабюнит и номер порта. Пожалуйста не меняйте нумерацию.<br /><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">Примечание :</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br />В IP PBX (CUCM) Обозначаются порты так: <br /><br /></span><strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">AALN/S0/SU1/1</span></strong><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br />Где:<br />S- Module<br />SU- Subunit<br />0/1/2... и.т.д. - Порт в Cisco куда подключаются аналоговые линии. <br /><br /><br />Пример :<br />Module in Slot 0 NM- 4VWIC- MBRD<br />Subunit 0 VIC2-2FXO <br />Subunit 1 VIC2-2FXS<br />Subunit 2 VIC3 - 4FXS/DID<br /><br />*** Номер порта начинается с 0<br /><br /><br /></span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\">ОТ ПРАКТИКИ К ТЕОРИИ.</span><span style=\"mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: RU; mso-fareast-language: RU; mso-bidi-language: AR-SA;\"><br />1. FXO (Foreign eXchange Office) &mdash; аналоговый интерфейс абонентских устройств телефонных станций.Устройства с таким интерфейсом подключаются к интерфейсу FXS. Так те же самые факсовые аппараты, телефоны, модемы реализуют интерфейс FXO.<br />2. FXS (АТС), а с другой &mdash; FXO (телефон). Таким образом, шлюзы с интерфейсом FXO подключаются вместо телефона. С их помощью можно организовать связь с ТФОП или предоставить доступ к IP-телефонии, используя &laquo;внутренние&raquo; (более дешевые) линии мини-АТС</span></p>', '2020-08-21 11:52:48', '2020-08-21 11:53:14'),
(51, 14, 'ip-телефония Е1 Дирекции. Модуль Расширения в Приемной', '<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong><span>Модуль Расширения ( Expansion Module) </span></strong><span><br /></span><strong><span>ИЗМЕНЕНИЕ/УДАЛЕНИЕ/СОЗДАНИЕ КНОПКИ БЫСТРОГО НАБОРА</span></strong><strong><span><br /></span></strong><span>Заявка.</span><span><br /></span><span><br /></span><span>Вн. номер телефона: 0321000&nbsp;<br />1.&nbsp;</span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Sukhopalov</span><span lang=\"EN-US\"> </span><span>&ndash;&gt;&nbsp;</span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Marchenkova</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US; mso-ascii-font-family: \'Trebuchet MS\'; mso-hansi-font-family: \'Trebuchet MS\'; mso-char-type: symbol; mso-symbol-font-family: Wingdings;\"><span style=\"mso-char-type: symbol; mso-symbol-font-family: Wingdings;\">&ndash;&gt;</span></span><span> 0321001<br />2. </span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Shustova</span><span>&nbsp;&ndash;&gt; </span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Shustova</span><span>&nbsp;&ndash;-&gt; 0321005<br />3. </span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Lukintseva </span><span>&ndash;&gt; </span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Lukintseva</span><span>&nbsp;&ndash;-&gt; 0321002</span><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><span>4. </span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Bogatyreva</span><span lang=\"EN-US\"> </span><span>&nbsp;&ndash;&gt; </span><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">Bogatyreva</span><span>&nbsp;&ndash;-&gt; 0321004</span><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><span lang=\"EN-US\" style=\"mso-ansi-language: EN-US;\">5. Leschev&nbsp;&ndash;&gt; Kvachakhiya &ndash