(53, 1, 'Удаленное запаролевание BIOS в Dell', '<p>Файлы есть на x:\\BIOS пароли\\Dell и на c:\\!IT\\BIOS\\Dell</p>\r\n<p>1. Используется Dell CCTK Configuration Wizard (Client Configuration Toolkit)</p>\r\n<p>2. Создан dell_psw.exe - все шаги показаны на картинках &rarr;</p>\r\n<p>3. Запустить его на целевом ПК</p>', '2020-09-02 11:36:50', '2020-09-02 11:36:50'),
(54, 12, 'Бизнес-Фабрика - SSD', '<div><strong>Симакин Максим</strong> Менеджер по продажам БИЗНЕС-ФАБРИКА</div>\r\n<div>&nbsp;</div>\r\n<div>БЦ Зенит-Плаза, г. Москва, 123458,&nbsp;ул. Маршала Прошлякова, д. 30, офис 503</div>\r\n<div>Тел.: +7 (495) 787-5800, вн.503&nbsp;</div>\r\n<div>Сот.: +7 (965) 404-5766</div>\r\n<div>E-mail: Simakin@f-2-b.ru</div>\r\n<div><a title=\"www.f-2-b.ru\" href=\"http://f-2-b.ru\" target=\"_blank\" rel=\"noopener\">http://f-2-b.ru</a></div>\r\n<p>&nbsp;</p>', '2020-09-22 11:02:51', '2020-09-22 11:02:51'),
(55, 10, 'МФУ Kyocera ECOSYS M 2540 dn', '<p>Дефолтные пароли:</p>\r\n<p>Логин: 4000</p>\r\n<p>Пароль: 4000</p>\r\n<p>В веб интерфейсе:</p>\r\n<p>Логин: Admin</p>\r\n<p>Пароль: Admin</p>\r\n<p>Настройки удобнее делать через веб интерфейс</p>', '2020-09-23 11:46:15', '2020-09-23 11:46:15'),
(56, 10, 'HP LJ 1320 установка на Windows 10', '<p><font face=\"Times New Roman\"> </font></p>\r\n<h3 style=\"background: white; margin: 0cm 0cm 9pt; mso-margin-top-alt: auto; mso-outline-level: 2;\"><span style=\"mso-bidi-font-family: Arial;\">Установка драйвера в Windows 10</span></h3>\r\n<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15pt; line-height: 18pt; mso-margin-top-alt: auto;\"><span style=\"mso-bidi-font-family: Arial;\">Есть трудности установки, если компьютер работает под управлением операционной системы Microsoft Windows 10. Если под рукой нет комплектного носителя с установочными файлами, то пользователь надеется на то, что установка произойдет автоматически. Компьютер может это сделать, определить принтер без установки драйвера, если информация о нем уже содержится в операционной системе. В случае HP LaserJet 1320, придется действовать вручную.</span></p>\r\n<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15pt; line-height: 18pt; mso-margin-top-alt: auto;\"><span style=\"mso-bidi-font-family: Arial;\">Необходимо зайти в &laquo;Панель управления&raquo; и открыть &laquo;Устройства и принтеры&raquo;.</span></p>\r\n<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15pt; line-height: 18pt; mso-margin-top-alt: auto;\"><span style=\"mso-bidi-font-family: Arial;\">В верхней части открывшегося окна нажать кнопку &laquo;Добавление принтера&raquo;. Прерываем процесс поиска, нажав на строку &laquo;Необходимый принтер отсутствует в списке&raquo;.</span></p>\r\n<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15pt; line-height: 18pt; mso-margin-top-alt: auto;\"><span style=\"mso-bidi-font-family: Arial;\">Выбрать последний из предложенных пунктов меню &laquo;Добавить локальный или сетевой принтер с параметрами, заданными вручную&raquo;.</span></p>\r\n<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15pt; line-height: 18pt; mso-margin-top-alt: auto;\"><span style=\"mso-bidi-font-family: Arial;\">Порт принтера оставить по умолчанию, и перейти далее.</span></p>\r\n<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15pt; line-height: 18pt; mso-margin-top-alt: auto;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"mso-bidi-font-family: Arial;\">Внимание!</span></strong><span style=\"mso-bidi-font-family: Arial;\"> В левом окне необходимо выбрать бренд HP. Далее нажать на &laquo;Центр обновления Windows&raquo; внизу. Операционная система обновит список поддерживаемых моделей.</span></p>\r\n<p><font face=\"Times New Roman\"> </font></p>\r\n<p style=\"background: white; margin: 0cm 0cm 0pt; line-height: 18pt; mso-margin-top-alt: auto;\"><span style=\"mso-bidi-font-family: Arial;\">Все готово. Теперь можно подключить принтер к компьютеру. Установка произойдет автоматически.</span></p>\r\n<p><font face=\"Times New Roman\"> </font></p>', '2020-10-22 11:06:27', '2020-10-22 11:06:27'),
(57, 15, 'Списание расходных материалов при поступлении на склад', '<div class=\"MsoNormal\"><span>В документ &laquo;Поступление оборудования на склад от поставщика&raquo; была добавлена кнопка &laquo;Создать перемещение&raquo;.</span><span></span></div>\r\n<div>&nbsp;</div>\r\n<div class=\"MsoNormal\"><span>Она позволяет перекинуть поступившие расходные материалы сразу на склад &laquo;Списание&raquo;. </span><span></span></div>\r\n<div class=\"MsoNormal\">&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div class=\"MsoNormal\"><span>Для этого необходимо:</span><span></span></div>\r\n<div>&nbsp;</div>\r\n<ol>\r\n<li class=\"MsoListParagraph\" style=\"text-indent: -18pt;\"><span><span style=\"mso-list: Ignore;\"><span style=\"font: 7pt/normal \'Times New Roman\'; font-size-adjust: none; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Войти в документ &laquo;Поступление оборудования на склад от поставщика&raquo; во вкладке &laquo;Документы&raquo;</span></li>\r\n<li class=\"MsoListParagraph\" style=\"text-indent: -18pt;\"><span><span style=\"mso-list: Ignore;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span>Выбрать поступление, из которого вам необходимо всю расходку перекинуть на склад &laquo;Списание&raquo;</span></li>\r\n<li class=\"MsoListParagraph\" style=\"text-indent: -18pt;\"><span><span style=\"mso-list: Ignore;\"><span style=\"font: 7pt/normal \'Times New Roman\'; font-size-adjust: none; font-stretch: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span>Не открывая документ, нажать кнопку &laquo;Создать перемещение&raquo;</span></li>\r\n<li class=\"MsoListParagraph\" style=\"text-indent: -18pt;\"><span><span style=\"mso-list: Ignore;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span>В открывшемся документе проставить склад, на который перемещаете оборудование </span></li>\r\n<li class=\"MsoListParagraph\" style=\"text-indent: -18pt;\"><span><span style=\"mso-list: Ignore;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span>Заполнить поле &laquo;Номер заявки&raquo;</span></li>\r\n<li class=\"MsoListParagraph\" style=\"text-indent: -18pt;\"><span><span style=\"mso-list: Ignore;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span>Далее записать документ и провести его (кнопки &laquo;Записать&raquo; &rarr; &laquo;Провести и закрыть&raquo;)</span><span></span></li>\r\n</ol>\r\n<div class=\"MsoListParagraph\" style=\"text-indent: -18pt; mso-list: l1 level1 lfo2;\">&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div class=\"MsoNormal\"><span>В документ автоматически подгружается все количество по поступившим позициям. Если вам необходимо списать расходку частично, то кол-во можно исправить вручную.</span><span></span></div>\r\n<div>&nbsp;</div>\r\n<div class=\"MsoNormal\"><span>Данная функция предназначена только для списания расходных материалов</span></div>', '2020-12-14 09:09:17', '2020-12-14 09:10:06'),
(58, 4, 'Не забыть включать SMB1', '<p>Не забыть включать SMB1</p>', '2020-12-16 13:15:07', '2020-12-16 13:15:07'),
(59, 6, 'Teams - нет ссылки на открытие собрания в браузере', '<p>Ссылка на открытие собрания в браузере доступна только в Google Chrome</p>', '2021-02-08 09:45:18', '2021-02-08 09:45:18');
